import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/FormControl';
import Button from 'react-bootstrap/Button';
import Logo from '../Logo/Logo';

const Navigation2 = () => {
  return (
    <Navbar bg="blue" variant="dark" >
      <Logo />
      <Nav className=" pt3 center'}}">
        <Nav.Link className='f3 link dim black underline pa3 pointer' href="#home">Industries</Nav.Link>
        <Nav.Link className='f3 link dim black underline pa3 pointer' href="#home">Consulting Services</Nav.Link>
        <Nav.Link className='f3 link dim black underline pa3 pointer' href="#features">Insights</Nav.Link>
        <Nav.Link className='f3 link dim black underline pa3 pointer' href="#pricing">About Us</Nav.Link>
        <Nav.Link className='f3 link dim black underline pa3 pointer' href="#pricing">Contact Us</Nav.Link>
      </Nav>
      <Form className='pa2' style={{display: 'flex', justifyContent: 'flex-end'}} >
        <FormControl type="text" placeholder="Search" className="mr-sm-2" />
        <Button variant="outline-info">Search</Button>
      </Form>
    </Navbar>
  )
}

export default Navigation2;
